import React from 'react'
import Input from '../components/Input'
import Button from '../components/Button'

function Login() {
  return (
        <form>
        <Input label="Username" type="email" />
        <Input label="Pass" type="email" />
        <Button title="Log In"/>
        </form>

  )
}

export default Login
